Enthusiastic and efficient, Lisa Wemert comes to real estate with a reputation for providing outstanding customer service. Lisa has extensive personal experience in property investment and is equipped with first-hand knowledge of the needs of her sellers and buyers.

Lisa has strong knowledge of the local property market which allows her to provide reliable advice to her clients. Focused and proactive, sellers in particular will find that Rhonda is the kind of agent who happily involves them in every aspect of a property transaction. A great communicator with a warm, easy-going approach, Lisa understands that sellers want to receive honest, up-to-date information about how their property is being received by potential buyers.

